<script>
import Swal from 'sweetalert2';
import axios from 'axios';

export default {
  data() {
    return {
      user_data_list: [], // This should hold the list of provinces fetched from the API
      user_data_districts: [], // This should hold the list of districts fetched from the API
      user_data_village: [], // This should hold the list of villages fetched from the API
      province: null,
      provinceLa: "",
      loading_processing: false, // State for loading processing
    };
  },
  async mounted() {
    await this.onGetprovin();
  },
  methods: {


    tolpb() {
      // Use router.push to navigate to the province route
      this.$router.push('/Lpbmap');
    },
    toxbl() {
      // Use router.push to navigate to the province route
      this.$router.push('/XBLmap');
    },
    async onGetprovin() {
      try {
        this.loading_processing = true;
        const response = await axios.get('https://octopus-app-n476x.ondigitalocean.app/provinces');
        this.loading_processing = false;
        if (response.data?.status === true) {
          this.user_data_list = response.data.data;
        } else {
          Swal.fire({
            title: 'ແຈ້ງເຕືອນ',
            text: response.data?.message,
            icon: 'info',
            allowOutsideClick: false,
            confirmButtonColor: '#3085d6',
            confirmButtonText: 'OK',
          });
        }
      } catch (error) {
        this.loading_processing = false;
        Swal.fire({
          title: 'ແຈ້ງເຕືອນ',
          text: error.message,
          icon: 'error',
          allowOutsideClick: false,
          confirmButtonColor: '#3085d6',
          confirmButtonText: 'OK',
        });
      }
    },
    onProvinceChange(provinceId) {
      this.user_data_districts = [];
      this.user_data_village = [];
      this.province = provinceId;
      if (this.province) {
        this.onGetdistricts(this.province);
        this.provinceLa = this.user_data_list.find((item) => item._id === this.province).provinceLa;
      }
    },
    async onGetdistricts(provinceId) {
      try {
        this.loading_processing = true;
        const response = await axios.get(`https://octopus-app-n476x.ondigitalocean.app/districts?provinceId=${provinceId}`);
        this.loading_processing = false;
        if (response.data?.status === true) {
          this.user_data_districts = response.data.data;
        } else {
          Swal.fire({
            title: 'ແຈ້ງເຕືອນ',
            text: response.data?.message,
            icon: 'info',
            allowOutsideClick: false,
            confirmButtonColor: '#3085d6',
            confirmButtonText: 'OK',
          });
        }
      } catch (error) {
        this.loading_processing = false;
        Swal.fire({
          title: 'ແຈ້ງເຕືອນ',
          text: error.message,
          icon: 'error',
          allowOutsideClick: false,
          confirmButtonColor: '#3085d6',
          confirmButtonText: 'OK',
        });
      }
    },
  },
};
</script>

